import {Link, useParams} from 'react-router-dom'
function Posts({ data }) {
    console.log(data);
   const params = useParams()
   console.log(params);
    return (
        <table border={1}>
            <thead>
                <tr>
                    <th>Id</th>
                    <th>Title</th>
                    <th>Action</th>
                </tr>
            </thead>
            <tbody>
                {!data ? <tr><td colSpan={3}><h2>loading</h2></td></tr> : data.map((item , i) => {
                    // console.log(item);
                    return <tr key={i}>
                        <td>{item.id}</td>
                        <td>{item.title}</td>
                        <td>
                           <Link to={'posts/:id'}>click</Link>
                        </td>
                    </tr>
                })}
            </tbody>
        </table>
    )
}
export default Posts
